function CookieManager(){this.names={DATES:"dates",TIME_AMOUNT:"timeAmount",TIME_UNIT:"timeUnit"}}CookieManager.prototype.getTimeUnit=function(){return this.getCookie(this.names.TIME_UNIT)};CookieManager.prototype.setTimeUnit=function(a){this.setCookie(this.names.TIME_UNIT,a)};CookieManager.prototype.getTimeAmount=function(){return this.getCookie(this.names.TIME_AMOUNT)};CookieManager.prototype.setTimeAmount=function(a){this.setCookie(this.names.TIME_UNIT,a)};
CookieManager.prototype.getDates=function(){var a=this.getCookie(this.names.DATES),b=[];null!==a&&""!==a&&a.split(":").forEach(function(a){var c=a.split("@");2===c.length?b.push(c):console.warn("invalid date cookie",a)});return b};CookieManager.prototype.setDates=function(a){var b="";"undefined"===typeof a&&(a=dateRowUtil.getStartRows());a.forEach(function(a,c){c&&(b+=":");b+=a.row.amountCell.toString()+"@"+a.row.dateCell.toString()});this.setCookie(this.names.DATES,b)};
CookieManager.prototype.getCookie=function(a){a+="=";for(var b=document.cookie.split(";"),d=0;d<b.length;d++){var c=b[d].trim();if(0==c.indexOf(a))return c.substring(a.length,c.length)}return null};CookieManager.prototype.setCookie=function(a,b){document.cookie=a+"="+b};
